def labeler(arr, label):
    new_arr = []

    for i in range(len(arr)):
        if 0 <= i <= 19:
            new_arr.append({'hex': arr[i], 'subtype': label[0]})
        elif 20 <= i <= 39:
            new_arr.append({'hex': arr[i], 'subtype': label[1]})
        elif 40 <= i <= 59:
            new_arr.append({'hex': arr[i], 'subtype': label[2]})

    print(new_arr)

def cvtToLAB(labeled_arr):
    new_arr = []

    for i in range(len(labeled_arr)):
        r = int(labeled_arr[i]['hex'][0:2], 16)
        g = int(labeled_arr[i]['hex'][2:4], 16)
        b = int(labeled_arr[i]['hex'][4:6], 16)
        rgb = sRGBColor(r, g, b, is_upscaled=True)
        lab = convert_color(rgb, LabColor, through_rgb_type=sRGBColor)
        new_arr.append({
            'lab': [lab.lab_l, lab.lab_a, lab.lab_b],
            'subtype': labeled_arr[i]['subtype']
        })

    print(new_arr)

